() => {
  const router = useRouter();
  const meQuery = queries.useGetMeWithContext();

  return (
    <Div className="flex flex-1 flex-row mx-10">
      <Div className="flex flex-1 flex-col">
        <P className="text-4xl">Sign up</P>
        <FunctionForm
          tsFunction={Index}
          withApiResult={(
            result: RealApiReturnType<"signupWithPasswordWithContext">
          ) => {
            if (result.isSuccessful && result.result?.isSuccessful) {
              router.push("/");
            }
            meQuery.refetch();

            successToast(
              result.result?.message || result.message || "No message"
            );
          }}
          hideResult
        />
        <ALink href="/login">Or click here to login</ALink>
      </Div>
    </Div>
  );
}
